import React from 'react';
import PropTypes from 'prop-types';

import './BasicListItem.css';

const BasicListItem = () => (
  <div className="basic-swipeable-list__item">
    <ListItem className={classes.listitem}>
      <ListItemAvatar >
          <img src={Zeep} alt="not found" width="60" height="60"/>
      </ListItemAvatar>
      <ListItemText className={classes.listItemText}>
        <Typography variant="h5">
                <TableCell className={classes.cell1}>Aloe Vera Zeep</TableCell>
                <TableCell className={classes.cell2}>14 st</TableCell>
        </Typography>

      </ListItemText>
      <ListItemSecondaryAction>
        <IconButton edge="end" aria-label="edit">
          <EditIcon fontSize="large"/>
        </IconButton>
      </ListItemSecondaryAction>
    </ListItem>
    <Divider />
  </div>
);

BasicListItem.propTypes = {
  label: PropTypes.string
};

export default BasicListItem;
